@{var status=Model.Fields["STATUS"];
var msg="";
var color="#3330B5";

if (status == 1) 
{
    msg="Cadastrada";
    color="#3330B5";
}
if (status == 2) 
{
    msg="Emitida";
    color="#21A81A";
}
if (status == 3) 
{
    msg="Cancelada";
    color="#CD2024";
}
if (status == 4) 
{
    msg="Com divergencias";
    color="#FFC923";
}
if (status == 5) 
{
    msg="Aguardando servidor";
    color="#92d3fc";
}
}
<span style="font-size: 30px; border-bottom: 2px solid @color;">@msg</span>

@{var statusNfe=Model.Fields["STATUSNFE"];
var status=Model.Fields["STATUS"];
var nomeStatus = Model.Definition.FieldDefinitions["STATUSNFE"].ToUI(Model["STATUSNFE"].Value);
var handleNFE = Model["HANDLENFE"].GetInt32();
if ((status == 1) || (status == 4) || (status == 5))
{
    return;
}

if (handleNFE == 0)
{
    <span class="label label-sm label-default">Sem NFe</span>
}
else if (statusNfe == 1) 
{
    <span class="label label-sm label-info" style="background-color: #3330B5;">@nomeStatus</span>
}
else if ((statusNfe == 2) || (statusNfe == 3) || (statusNfe == 4))
{
    <span class="label label-sm label-danger" style="background-color: #FFC923;">@nomeStatus</span>
}
else if ((statusNfe == 5) || (statusNfe == 7) || (statusNfe == 8))
{
    <span class="label label-sm label-success" style="background-color: #CD2024;">@nomeStatus</span>
}
else if (statusNfe == 6) 
{
    <span class="label label-sm label-success" style="background-color: #21A81A;">@nomeStatus</span>
}
else if ((statusNfe == 9) || (statusNfe == 10))
{
    <span class="label label-sm label-success" style="background-color: #FFA500;">@nomeStatus</span>
}
}

@{var statusMDe=Model.Fields["STATUSMDE"];
